actionConfiguration.body:
() => {
  let data = getReferenceInfoFilters.data;
  if (!data || !data.actions) {
    return [];
  }
  let actions = [];
  for (let action of data.actions) {
    actions.push({
      "label": action,
      "value": action
    });
  }
  return actions;
}

